   [61]={next_id=62, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="石头让他的身体发生了变化，让他获得了抵抗怪物的能力。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [62]={next_id=63, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="他成功击退了怪物，他保护了部落里的人们，他成了部落里的大英雄。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [63]={next_id=64, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="他把石头分享给族人，有的族人成了怪物，有的族人，获得了与他一样的力量。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [64]={next_id=65, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="曾经消失的希望，好像又出现了。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [65]={next_id=66, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="族人们看到了活下去的可能，即使……这个可能性带着疯狂的色彩。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [66]={next_id=67, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="他们把石头供奉起来，称获得力量，保护部落的人们为鹿灵祭司。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [67]={next_id=68, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="他们在失去政府庇护的角落里施行自救，他们在无人在意的角落顽强延续。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [68]={next_id=69, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="斯利普尼尔……意为“不该存在之物”。我们本该在那一场灾祸中覆灭，却依靠着一代又一代鹿灵祭司的庇护，延续至今……", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [69]={next_id=70, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="而那些未成为鹿灵祭司的勇士们，被埋葬于这片土地，永远接受着后世的歌颂。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
