   [74]={next_id=75, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="到你这一代时，修格尔已经极少出现了，部落里的许多人，甚至都未曾见过真正的危险。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [75]={next_id=76, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="一切好像已经回到了正轨。阳光……温度……似乎与传说中的当年别无二致。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
