   [77]={next_id=78, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="我们鹿灵祭司的选拔……应该也可以停止了吧。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [78]={next_id=79, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="当年你和费尔达南一同进入试炼室的时候……我曾想，你们会是最后一批“受试”的孩子。噩梦，在你们这一代便可以终结了。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
