   [80]={next_id=81, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="费尔南达的“试炼”出现了意外。锚点……降临了。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [81]={next_id=82, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="刚获得力量的费尔南达拼死保护了我们，但在锚点自行关闭之后，却因为感染导致了异变……我们不得不亲手杀死了自己的英雄。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [82]={next_id=83, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="锚点的出现，告诉我们，这一切，并没有结束。噩梦……还得继续下去。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
