   [84]={next_id=85, abreast_id={}, pType =1, cg_type =0, dialog=1, msg="从那位自称巡林员的人出现在我们部落到如今，短短一个多月，修格尔出现得越来越频繁。听说主城也被突然出现的修格尔弄得疲惫不堪。", msg_color="", msg_size=0, talker="乌恩", audio="", img="arts/ui/bg/story/storybg_802.jpg", video_url="", music_id=0, background_music="", model_tid={{ 2, "7148", 2, 0}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, update_model={{ 2,1}}, role_act={}, head_path="", flash_time=0, shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
